import styled from 'styled-components';


/* Header Container */
export const Container = styled.header`
    display: flex;
    justify-content: space-between;
    padding: 20px 150px;
    position: absolute;
    width: calc(100vw - 300px);
    z-index: 3;

    @media screen and (max-width: 768px) {
        padding: 12px 24px;
        width: calc(100vw - 48px);
        justify-content: center;
        align-items: center;
    }
`
